    std::string name;
    int age;
    std::string address;

    std::cout << "Enter the person's name: ";
    std::cin >> name;

    std::cout << "Enter the person's age: ";
    std::cin >> age;

    std::cout << "Enter the person's address: ";
    std::cin.ignore(); // Ignore newline character left by previous input
