namespace ElectricVehicleBlades.Services
{
    public class ElectricVehicleApiService : IElectricVehicleApiService
    {
        private readonly IHttpClientFactory _httpClientFactory;

        public ElectricVehicleApiService(IHttpClientFactory httpClientFactory)
        {
            _httpClientFactory = httpClientFactory;
        }

        public async Task<List<ElectricVehicle>> GetElectricVehicles()
        {
            var httpClient = _httpClientFactory.CreateClient();

            var response = await httpClient.GetAsync("https://raw.githubusercontent.com/OpenEVSE/Open-EVSE/master/data/vehicles.json");

            if (!response.IsSuccessStatusCode)
            {
                throw new HttpRequestException($"Failed to retrieve electric vehicles: {response.StatusCode}");
            }

            var content = await response.Content.ReadAsStringAsync();

            var electricVehicles = JsonConvert.DeserializeObject<List<ElectricVehicle>>(content);

            return electricVehicles ?? new List<ElectricVehicle>();
        }
    }
}


